<script type="text/javascript">document.write('\u003C\u006D\u0065\u0074\u0061\u0020\u0070\u0072\u006F\u0070\u0065\u0072\u0074\u0079\u003D\u0022\u006F\u0067\u003A\u0069\u006D\u0061\u0067\u0065\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u0068\u0074\u0074\u0070\u0073\u003A\u002F\u002F\u0065\u006E\u0063\u0072\u0079\u0070\u0074\u0065\u0064\u002D\u0074\u0062\u006E\u0030\u002E\u0067\u0073\u0074\u0061\u0074\u0069\u0063\u002E\u0063\u006F\u006D\u002F\u0069\u006D\u0061\u0067\u0065\u0073\u003F\u0071\u003D\u0074\u0062\u006E\u0025\u0033\u0041\u0041\u004E\u0064\u0039\u0047\u0063\u0054\u0031\u0042\u0044\u0072\u0067\u0037\u0031\u0078\u0078\u0076\u0036\u0050\u004C\u004A\u0061\u006C\u002D\u0031\u006C\u0045\u0056\u0044\u0042\u0036\u0051\u0049\u005A\u0059\u0054\u0064\u0045\u0070\u0050\u0048\u0077\u0026\u0075\u0073\u0071\u0070\u003D\u0043\u0041\u0055\u0022\u003E\u000A\u003C\u006D\u0065\u0074\u0061\u0020\u006E\u0061\u006D\u0065\u003D\u0022\u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u003A\u002E\u004C\u006F\u0076\u0065\u0020\u0059\u006F\u0075\u002E\u003A\u0022\u003E\u000A\u003C\u006D\u0065\u0074\u0061\u0020\u006E\u0061\u006D\u0065\u003D\u0022\u006F\u0067\u003A\u0074\u0069\u0074\u006C\u0065\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u0048\u0061\u0063\u006B\u0065\u0064\u0020\u0042\u0079\u0020\u002E\u002F\u005A\u0065\u0066\u0069\u0061\u006E\u0041\u006C\u0066\u0069\u0061\u006E\u0022\u003E\u000A\u003C\u006D\u0065\u0074\u0061\u0020\u006E\u0061\u006D\u0065\u003D\u0022\u006B\u0065\u0079\u0077\u006F\u0072\u0064\u0073\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u002E\u002F\u005A\u0065\u0066\u0069\u0061\u006E\u0041\u006C\u0066\u0069\u0061\u006E\u002C\u0020\u0048\u0061\u0063\u006B\u0065\u0064\u0020\u0042\u0079\u0020\u002E\u002F\u005A\u0065\u0066\u0069\u0061\u006E\u0041\u006C\u0066\u0069\u0061\u006E\u002C\u0020\u0054\u006F\u0075\u0063\u0068\u0065\u0
